import React from 'react';
import './Logo.css'
import { Link } from 'react-router-dom';

export default props => (
    <aside className="logo" >
        <Link to="/" className="logo">
            <img src="../../images/react-logo" height="42" width="42" />
        </Link>
    </aside>
)
